description:
Swing Bridge

Technology Documentary hosted by Matt Rogers, published by Discovery Channel broadcasted as part of DC Really Big Things series in 2007 - English narration


Information
------------------------------

Matt checks out the General Electric's &quot;Evolution&quot; series locomotive plant in Erie, Pennsylvania, a dredger on the Mississippi River, and the Spokane Street swing bridge in Seattle.

